    <title lang="en">Rosy Business</title>
    <desc lang="en">HONG PO KEI's (Tang Shui Man, Sheren) engagement with Wuxi rice baron TSEUNG KIU (Yueh Wah) broke off many years ago when a natural disaster hit the country. Later when the country was running out of food supply her whole family was killed and she become a criminal. Over the years, KEI has never got over KIU. She has been trying to prove he is not as heartless as the others think. Fate has it that they meet again and she becomes his fourth wife. KIU's first and second wives, YAN FUNG YEE (Tse Suet Sum) and PANG KIU (Sheung Tin Ngor, Kiki), always make things difficult for KEI. KEI, who is an extremely clever person who never wastes time on trivial things, turns every threat into an opportunity. This makes KIU appreciate her wisdom and persistence. He entrusts his business to her and tells her to find a suitable successor for him before he dies. Despite all the attacks in the family, KEI manages to keep the business in good shape. She has never forgotten KIU's last wish, too. By chance, she discovers that TSEUNG PIT CHING (Ng Cheuk Hai, Ron), KIU's second son, is not really a playboy but an upright person loved by everyone in the shop. She therefore guides and helps him in every possible way, but her efforts are met with CHAI KAU's (Lai Yiu Cheung) challenges. KAU seeks vengeance for being mistreated and wants a pay back from TSEUNG family. After rounds after rounds of battle wits and actual fights, KEI and KAU begin to appreciate each other. KAU even falls for KEI as time goes by…</desc>
