    <title lang="en">Silver Chamber Of Sorrows, The</title>
    <desc lang="en">“Sheung's Silver Chamber”, the largest jewel company in Foshan, Guangdong Province China, is facing serious financial difficulties. In order to obtain a loan from SHUM's family, SHEUNG HANG (Chun Pui), owner of the Chamber, together with his primary wife, CHOI SIU-DIP (Sit Ka Yin), plot to arrange marriage between SHEUNG WAN (Ng Wai Kwok), HANG's younger brother, and SHUM WING-TUNG (Young Yuen Yee), daughter of SHUM's family. Fueled by hatred, CHING SAU-HANG (Ng Wing Mei), WAN's lover, marries HANG and ironically becomes WAN's sister-in-law. WAN falls out with HANG, and opts to live abroad and disconnects from his family. After leaving home for years, WAN does not return home until the occasion to celebrate his father's birthday. Tension between the two brothers comes to a head when HANG is reluctant to pay ransom to save the youngest son of WAN. WAN is determined to disconnect completely from his family ever since. Since WAN's return, SAU-HANG suffers from her husband's neglect and gets framed for causing the fourth concubine FEI FEI's (Wu Ting Yan) miscarriage. Hatred leads her to commit act that revenge. She seeks to subvert SHEUNG's family by luring KWAN. Intentionally, she unveils TSAU KUK (Yeung Sze Ki), the maid in the family, is HANG's illegitimate daughter. The dark age of a once-prominent family begins…</desc>
